  [],\n\t\"revision_timestamp\": \"2013-03-15T21:21:08.108973\",\n\t\"name\": \"estimates-of-agricultural-expenses-in-counties-in-the-conterminous-united-states-as-reported-in\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This coverage contains estimates of agricultural
  expenses in counties in the conterminous United States as reported in the 1987 Census
  of Agriculture (U.S. Department of Commerce, 1989a). Agricultural expenses data
  are reported in thousands of dollars. Agricultural expenses estimates were generated
  from surveys of all farms where $1,000 or more of agricultural products were sold,
  or normally would have been sold, during the census year. Most of the attributes
  summarized represent 1987 data, but some information from the 1982 Census of Agriculture
  also was included. The polygons representing county boundaries in the conterminous
  United States, as well as lakes, estuaries, and other nonland-area features were
  derived from the Digital Line Graph (DLG) files representing the 1:2,000,000-scale
  map in the National Atlas of the United States (1970). Agricultural expenses Census
  of Agriculture Counties United States\",\n\t\"license_title\": null,\n\t\"extras\":
