  \"completed\"\n\t},\n\t{\n\t\t\"key\": \"access_constraints\",\n\t\t\"value\": \"[\"Use
  Constraints: CENSUS DATA Estimates of agricultural expenses by county were reported
  by the U.S. Department of Commerce (1989a, 1898b) in the 1987 Census of Agriculture.
  The estimates were constructed from surveys of all farms where $1,000 or more of
  agricultural products were sold, or normally would have been sold, during the census
  year. Sampling and statistics were used to account for nonresponding farm operations.
  Thus, the information in the Census of Agriculture is subject to sampling variability
  as well as reporting and coverage errors. Census disclosure rules prevent publication
  of information that would disclose the operation of individual farms. Thus, for
  example, one or two sod farms may be reported in a county, but no acreage of sod
  harvested is reported, because release of that information might disclose information
  about a particular farmer's operation. COUNTY BOUNDARIES The original files for
  this map were provided in 15 sections. Boundaries near the edges of sections have
  been adjusted in edgematching. Polygons that extend into the water (an ocean or
  the Great Lakes) should be considered arbitrary.\", \"Access Constraints: (describe
